### @nuance・23  SN23 SocialTensor and NicheTensor are Merging

We are thrilled to announce that SocialTensor and NicheTensor are merging to take this subnet to new heights!

SocialTensor's enterprise-grade team includes industry veterans from Microsoft and major Wall Street banks, and are experts at making enterprise and user facing applications. For example their X product https://x.com/MakeItAQuote, which packages tweets into visually pleasing quotes, has over 600k followers. Soon it will be powered by Bittensor to generate images to go along with their quotes.

### What does this mean for the subnet?

Rest assured the direction of the subnet remains the same, but now we have a greater team to accelerate, scale it and integrate it with real world application, focusing on developing cutting-edge tools and monetization strategies. 

